import { NavLink } from "react-router-dom";

export default function Header() {
  return (
    <div className="component">
      <div id="header">
        <h2>Paper Trade</h2>
        <NavLink className="nav-link" to="/">
          Sign Out
        </NavLink>
      </div>
    </div>
  );
}
